import React from 'react';
import './Contact.css';

function Contact() {
  return (
    <section className="Contact">
      <h2>Ask me what I can make for your company</h2>
      <a href="mailto:rcdb.orourke@gmail.com?subject=Portfolio enquiry" className="Contact-link"><p>Get in touch by email</p></a>
      <a href="#" className="Contact-link"><p>Get in touch through LinkedIn</p></a>
    </section>
  );
}

export default Contact;
